          html: `<script defer data-name="homepage">
(function(){
  // Smooth scroll behavior for internal links
  const internalLinks = document.querySelectorAll('a[href^="#"]')

  internalLinks.forEach((link) => {
    link.addEventListener("click", function (e) {
      const targetId = this.getAttribute("href")
      if (targetId === "#") return

      const targetElement = document.querySelector(targetId)
      if (targetElement) {
        e.preventDefault()
        targetElement.scrollIntoView({ behavior: "smooth", block: "start" })
      }
    })
  })

  // Intersection Observer for scroll animations
  const observerOptions = {
    threshold: 0.1,
    rootMargin: "0px 0px -100px 0px",
  }

  const animateOnScroll = new IntersectionObserver((entries) => {
    entries.forEach((entry) => {
      if (entry.isIntersecting) {
        entry.target.style.opacity = "1"
        entry.target.style.transform = "translateY(0)"
      }
    })
  }, observerOptions)

  // Apply animation to cards
  const cards = document.querySelectorAll(
    ".portfolio__card, .skills__card, .experience__card, .contact__method"
  )
  cards.forEach((card) => {
    card.style.opacity = "0"
    card.style.transform = "translateY(20px)"
    card.style.transition = "opacity 0.6s ease, transform 0.6s ease"
    animateOnScroll.observe(card)
  })

  // Hero typing effect for tagline
  const tagline = document.querySelector(".hero__tagline")
  if (tagline) {
    const originalText = tagline.textContent
    tagline.textContent = ""
    let charIndex = 0

    const typeChar = () => {
      if (charIndex < originalText.length) {
        tagline.textContent += originalText.charAt(charIndex)
        charIndex++
        setTimeout(typeChar, 50)
      }
    }

    setTimeout(typeChar, 500)
  }

  // Contact form submission
  const contactForm = document.querySelector(".contact__form-fields")
  if (contactForm) {
    contactForm.addEventListener("submit", function (e) {
      e.preventDefault()

      const nameInput = document.getElementById("contact-name")
      const emailInput = document.getElementById("contact-email")
      const messageInput = document.getElementById("contact-message")

      // Basic validation
      if (nameInput.value && emailInput.value && messageInput.value) {
        alert(
          "Thank you for your message! I'll get back to you within 48 hours."
        )
        contactForm.reset()
      }
    })
  }

  // Parallax effect for visual cards
  const visualCards = document.querySelectorAll(".contact__visual-card")
  let ticking = false

  function updateParallax(scrollPos) {
    visualCards.forEach((card, index) => {
      const speed = (index + 1) * 0.05
      const yPos = -(scrollPos * speed)
      card.style.transform = \`translateY(\${yPos}px) translateZ(\${
        (3 - index) * 15
      }px)\`
    })
    ticking = false
  }

  window.addEventListener("scroll", function () {
    const scrollPos = window.pageYOffset

    if (!ticking) {
      window.requestAnimationFrame(function () {
        updateParallax(scrollPos)
      })
      ticking = true
    }
  })

  // Glow effect on skill proficiency bars
  const proficiencyBars = document.querySelectorAll(".skills__proficiency-bar")
  const barObserver = new IntersectionObserver(
    (entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          const bar = entry.target
          const width = bar.style.width
          bar.style.width = "0"
          setTimeout(() => {
            bar.style.width = width
            bar.style.transition = "width 1s ease"
          }, 100)
          barObserver.unobserve(bar)
        }
      })
    },
    { threshold: 0.5 }
  )

